        var arr = oldarr.slice(0);
        function getphoto() {
            $.post('/diantong/ajaxgetnewphoto2', {}, function (data) {
                var list = eval('(' + data + ')');
                if (list.code != '10000') {
                    alert(list.result);
                } else {
                    if (list.result != '') {
                        if (list.result == '结束动效开启') {
                            $(".bg").fadeOut(6000);
                            $(".new_bg").fadeIn(2000);
                        } else {
                            for (var i = 0; i < list.result.length; i++) {
                                setTimeout('setpic("' + list.result[i].pic + '")', i * 330);
                            }
                        }
                    }
                }
            });
        }

        //随机一张图片，替换掉
        function setpic(url) {
            if (arr.length == 0) {
                arr = oldarr.slice(0);
            }
            var num = Math.floor(Math.random() * arr.length);
            $('#pic' + arr[num]).attr('src', url);
            trans($('#pic' + arr[num]));
            arr.splice(num, 1);

        }


        $("#pic1").click(function () {
            $(".bg").fadeOut(6000);
            $(".new_bg").fadeIn(2000);

        })

    </script>

